import axios from "axios";
import { useEffect, useState } from "react";
import { useNavigate, useParams } from "react-router-dom";

const URI = 'http://localhost:8000/oneCancha/';
const updURI = 'http://localhost:8000/updateCancha/';

const CompEditCancha = () => {
    const navigate = useNavigate();
    const { ID_Encargado } = useParams(); //se guarda como un objeto, por ello los corchetes
    const [Tipo_Cancha, setTipoCancha] = useState('');
    const [Numero_Cancha, setNumeroCancha] = useState('');
    const [Material_Piso, setMateriaPiso] = useState('');
    const [Techado, setTechado] = useState('');
    const [Con_Gradas, setConGradas] = useState('');
    const [Estado, setEstado] = useState('');
    const [Capacidad_Jugadores, setCapacidadJugadores] = useState('');

    // Procedimiento para actualizar
    const update = async (e) => {
        e.preventDefault();
        // en este caso pasamos la URI más la id, justo como se hizo en las pruebas con thunderclient
        await axios.put(updURI+ID_Encargado, {
            Tipo_Cancha: Tipo_Cancha,
            Numero_Cancha: Numero_Cancha,
            Material_Piso: Material_Piso,
            Techado: Techado,
            Con_Gradas: Con_Gradas,
            Estado: Estado,
            Capacidad_Jugadores: Capacidad_Jugadores,
        });
        navigate('/'); // Regresamos al principio
    };

    const getCanchaById = async () => {

        const res = await axios.get(URI+ID_Cancha);
        try {
            console.log("Respuesta de la api", res.data)
            setTipoCancha(res.data.Tipo_Cancha || '');
            console.log("Tipo_Cancha", res.data.Tipo_Cancha)
            setNumeroCancha(res.data.Numero_Cancha || '');
            setMateriaPiso(res.data.Material_Piso || '');
            setTechado(res.data.Techado || '');
            setConGradas(res.data.Con_Gradas || '');
            setEstado(res.data.Estado || '');
            setCapacidadJugadores(res.data.Capacidad_Jugadores || '');
            setContraseña(res.data.Contraseña || '');
            
        } catch (error) {
            console.log("Error al obtener datos", error);
        }
    };

    useEffect(() => {
        getCanchaById();
    }, []);

    return (
        <div className="formulario">
            <h1>Editar encargado existente</h1>
            <form onSubmit={update}>
                <div className="form-group">
                    <label>Tipo_Cancha</label>
                    <input type="text" value={Tipo_Cancha} onChange={(e) => setNombre(e.target.value)} className="form-control" />
                </div>
                <div className="form-group">
                    <label>Primer Apellido</label>
                    <input type="text" value={Numero_Cancha} onChange={(e) => setPrimerApellido(e.target.value)} className="form-control" />
                </div>
                <div className="form-group">
                    <label>Segundo Apellido</label>
                    <input type="text" value={Material_Piso} onChange={(e) => setSegundoApellido(e.target.value)} className="form-control" />
                </div>
                <div className="form-group">
                    <label>Teléfono Fijo</label>
                    <input type="text" value={Techado} onChange={(e) => setTelefonoFijo(e.target.value)} className="form-control" />
                </div>
                <div className="form-group">
                    <label>Teléfono Móvil</label>
                    <input type="text" value={Con_Gradas} onChange={(e) => setTelefonoMovil(e.target.value)} className="form-control" />
                </div>
                <div className="form-group">
                    <label>Estado</label>
                    <input type="text" value={Estado} onChange={(e) => setCargo(e.target.value)} className="form-control" />
                </div>
                <div className="form-group">
                    <label>RFC/CURP</label>
                    <input type="text" value={Capacidad_Jugadores} onChange={(e) => setRFCCURP(e.target.value)} className="form-control" />
                </div>
                <div className="form-group">
                    <label>Contraseña</label>
                    <input type="password" value={Contraseña} onChange={(e) => setContraseña(e.target.value)} className="form-control" />
                </div>
                <button type="submit" className="btn btn-primary">Actualizar encargado</button>
            </form>
        </div>
    );
}

export default CompEditCancha;
